description:
This is a Dreamcast emulation using nullDC 1.04, just follow the very simple instructions in the README!! text file.

In spite of this being called Alien Front Online, your chances of 
getting a working server are pretty slim, so this is offline only but the single player mode is why I'm uploading this, it's a lot of fun.

A neat high paced shooter, play as an alien, or soldier.

I have included Xpadder with a profile for the Xbox360 controller allowing you to use both analog sticks rather than just the one.

